import React, { useState, useEffect } from 'react';
import axios from 'axios';

function AdminPanel() {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5001/api/bookings')
      .then(res => {
        if (res.data.success) {
          setBookings(res.data.bookings);
        }
      });
  }, []);

  return (
    <div className="admin-panel-container">
      <h2>Admin Panel - All Bookings</h2>
      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            <th>Booking ID</th>
            <th>User Name</th>
            <th>Source City</th>
            <th>Destination City</th>
            <th>Train ID</th>
            <th>Time Slot ID</th>
            <th>Seat ID</th>
            <th>Booking Time</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map(booking => (
            <tr key={booking.id}>
              <td>{booking.id}</td>
              <td>{booking.username}</td>
              <td>{booking.source_city_name}</td>
              <td>{booking.destination_city_name}</td>
              <td>{booking.train_id}</td>
              <td>{booking.time_slot_id}</td>
              <td>{booking.seat_id}</td>
              <td>{booking.created_at}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminPanel;
